import React from 'react'
import { FaPlus } from 'react-icons/fa'
export default function AddUser() {
  return (
    <div className="p-10 font-mono w-full text-md font-medium transition-all">
      <p className="text-white text-4xl mb-4">Usuarios</p> 
      <div className="flex flex-row items-center space-x-2 text-white text-xl">
        <FaPlus />
        <span>Add User</span>
      </div>
    </div>
  )
}
